import React, { Component } from 'react';
import LogContainer from './LogContainer'

class HomeContainer extends Component{
  render(){
    return(
      <div>
      <h1 className="ui header">
      <i className="circular users icon"></i>
      T1DLog
      </h1>
      <LogContainer/>
      </div>
    )
  }
}

export default HomeContainer
